import React from 'react';
import './App.css';
import { Switch, Route } from "react-router-dom"
import Header from './components/Header'
import firebase from './utils/Firebase'

function App() {

  firebase.firestore().collection('Teste').add({
    tittle: 'This is a test',
    postedby: 'matheus',
    time: 11
  })

  return (
    <div>
      <Header />
      <h1>Hello World!</h1>
    </div>
  );
}

export default App;
